import http from "../http-common";
let authToken = null;

const setAuthToken = (token) => {
  authToken = token;
};

const getAll = () =>{
    return http.get("/TypeCar");
};

const get = id_typeCar =>{
    return http.get(`/TypeCar/${id_typeCar}`);
};

const create = data => {
    const config = {
      headers: {
        Authorization: `Bearer ${authToken}`, // Agrega el token a los encabezados de la solicitud
      },
    };
    return http.post("/TypeCar", data, config); // Pasa la configuraci칩n del encabezado como el tercer par치metro
  };

const update = (id_typeCar,data) =>{
    return http.put(`/TypeCar`,data);
};

const remove = id_typeCar => {
    return http.delete(`/TypeCar/${id_typeCar}`);
};

const TypeCarServices = {
    getAll,
    get,
    create,
    update,
    remove,
    setAuthToken,
};

export default TypeCarServices;
